import React from "react";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import { elementNames } from '../utilities/constants';

const useStyles = makeStyles((theme) => ({
	preContainer: {
		display:"inline-block", 
		padding:"0 1em",
		margin: "0 0 0.5em",
	},
	preStyle: {
		marginTop: 0,
	},
}));

const DisplayJson = (props) => {
	const { jsonresp, submittedParams } = props;
    const classes = useStyles();
    const eNames = elementNames();
    const sElems = [{name:"date"}, ...submittedParams.elems];


    return (
        <>
            <Paper variant="outlined" className={classes.preContainer}>
                <Typography variant="subtitle1">
                    Results:
                </Typography>
                <pre className={classes.preStyle}>
                    {JSON.stringify(jsonresp[0], null, 2)}
                </pre>
                {jsonresp[0].map((col,i) => (
                    <p>{eNames[sElems[i].name]}: {col}</p>
                ))}

            </Paper>
            <br />
        </>
    );
}

export default DisplayJson;
